import React, { Component } from 'react'
import { PageHeader } from 'antd';

export default class Site extends Component {
    render() {
        return (
            <div>
                <PageHeader
                    className="site-page-header"
                    title="站点管理"
                    subTitle="新增"
                />
            </div>
        )
    }
}
